$Base64_32 ="" 
$Base64_64 =""

function memoryDump([Parameter(Mandatory=$true)]$path)
{
	$os_bit =(Get-WmiObject Win32_OperatingSystem).OSArchitecture
	$endpoint =[System.Net.Dns]::GetHostName()
	$date =Get-Date -Format "dd_MM_yy_HH_mm"
	$filename = $endpoint + "_" + $date + "_" + $os_bit
	
	if($os_bit -eq "64-bit") {	
		$result =$path + "Results.txt"
		$path =$path + $filename + ".mem"		
		$Content = [System.Convert]::FromBase64String($Base64_64)
		Set-Content -Path $env:temp\winpmem_mini_x64_rc2.exe -Value $Content -Encoding Byte
		$exe = $env:temp + "\winpmem_mini_x64_rc2.exe " + $path
		iex $exe
		New-Item -Path $result -ItemType "file" -Value "Memory dump was created."
		
}
	else {
		$result =$path + "Results.txt"
		$path =$path + $filename + ".mem"		
		$Content = [System.Convert]::FromBase64String($Base64_32)
		Set-Content -Path $env:temp\winpmem_mini_x86.exe -Value $Content -Encoding Byte
		$exe = $env:temp + "\winpmem_mini_x86.exe " + $path
		iex $exe
		New-Item -Path $result -ItemType "file" -Value "Memory dump was created."
}	
}

$path =$args[0]
if ($path -notmatch '\\$')
{
	$path += '\'
}

if (Test-Path -Path $path) {
    memoryDump $path
} else {
    Write-Error "Path doesn't exist."
}



